INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (44, 27, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 2, "人助け、応援", "人助けが大好き！　前向き格闘娘", 8, 16, 155, "トゥインクルウィッシュ", "A", "東山奈央", 100101, "ヒヨリ", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (47, 5, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 2, "料理、人間観察", "戦闘のサポートが得意な、心優しい少女", 4, 17, 158, "トゥインクルウィッシュ", "O", "種田梨沙", 100201, "ユイ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, 12, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 2, "読書、乗馬、お茶", "クールで何事にも真っ直ぐな剣士", 1, 18, 163, "トゥインクルウィッシュ", "B", "早見沙織", 100301, "レイ", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (27, 10, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 5, "いたずら、探検", "探検好きのイタズラっ子", 8, 9, 128, "リトルリリカル", "O", "諸星すみれ", 100401, "ミソギ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, 25, "？？？", 8, "ヒーローごっこ", "ヒーローに憧れる騎士見習いの少女", 11, 12, 146, "王宮騎士団（NIGHTMARE）", "O", "下田麻美", 100501, "マツリ", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, 22, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 7, "サックス", "甘え上手なみんなの人気者", 11, 13, 150, "悪魔偽王国軍（ディアボロス）", "O", "浅倉杏美", 100601, "アカリ", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (32, 23, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 7, "プリンを食べること", "プリン大好きゴースト娘", 1, 14, 130, "悪魔偽王国軍（ディアボロス）", "B", "雨宮天", 100701, "ミヤコ", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 15, "鏡で自分を見ること", "ボクは誰よりも美しい", 10, 14, 150, "ヴァイスフリューゲル　ランドソル支部", "AB", "大空直美", 100801, "ユキ", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (45, 5, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 13, "小説執筆", "前世を信じる中二病患者、「疾風の冥姫」", 7, 17, 159, "トワイライトキャラバン", "A", "髙野麻美", 100901, "アンナ", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, 22, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 10, "空想、ぬいぐるみ集め", "マホマホ王国のプリンセス", 9, 16, 155, "自警団（カォン）", "O", "内田真礼", 101001, "マホ", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (44, 25, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 3, "お裁縫", "人懐っこくてマシンガントークな妹系少女", 8, 15, 156, "ラビリンス", "A", "阿澄佳奈", 101101, "リノ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, 24, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 6, "妹と遊ぶこと、二度寝、昼寝、早寝", "みんなのために超能力を使う眠り姫", 12, 17, 156, "フォレスティエ", "A", "大橋彩香", 101201, "ハツネ", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (55, 21, "", 13, "読書、魔法", "オタク全開な魔法少女", 8, 18, 166, "トワイライトキャラバン", "O", "佳村はるか", 101301, "ナナカ", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (41, 3, "test", 10, "読書、推理", "頭脳明晰な美少女名探偵", 11, 15, 152, "自警団（カォン）", "AB", "水瀬いのり", 101401, "カスミ", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (54, 5, "test", 6, "絵本作り", "母性溢れる優しいみんなの「ミサト先生」", 9, 21, 165, "フォレスティエ", "O", "國府田マリ子", 101501, "ミサト", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (48, 10, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 14, "ファッション", "天真爛漫で人気者のカリスマモデル", 4, 18, 167, "ルーセント学院", "O", "上坂すみれ", 101601, "スズナ", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (53, 7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 10, "踊り、空手", "いつでも「なんくるないさ～」な天然娘", 7, 19, 158, "自警団（カォン）", "A", "高森奈津美", 101701, "カオリ", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (52, 14, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 14, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "多くの男性を魅了する無垢な女教師", 8, 23, 162, "ルーセント学院", "B", "伊藤静", 101801, "イオ", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (21, 3, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 5, "かわいいもの集め", "お歌もにんじんも、ウサギさんも大好き♪", 4, 10, 117, "リトルリリカル", "O", "日高里菜", 102001, "ミミ", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, "観劇、おままごと", "泣き虫で臆病な守ってあげたい女の子", 6, 12, 150, "サレンディア救護院", "B", "植田佳奈", 102101, "クルミ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, 22, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 7, "ゲーム全般", "人見知りであまのじゃくな女の子", 11, 13, 150, "悪魔偽王国軍（ディアボロス）", "O", "原紗友里", 102201, "ヨリ", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (38, 10, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 9, "屋内でできる遊び", "ぷうきちといつも一緒！", 5, 14, 148, "サレンディア救護院", "B", "芹澤優", 102301, "アヤネ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 9, "ご奉仕", "お嬢さまのためにがんばるドジっ娘メイド", 12, 15, 154, "サレンディア救護院", "O", "悠木碧", 102501, "スズメ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, 1, "test", 11, "あんパン", "遊びと睡眠が何より大事なぐうたら娘", 1, 17, 144, "牧場（エリザベスパーク）", "B", "小岩井ことり", 102601, "リン", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, 30, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 13, "実験、裁縫、料理", "運命の相手に一途すぎる乙女", 7, 16, 154, "トワイライトキャラバン", "B", "橋本ちなみ", 102701, "エリコ", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, 4, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 9, "経営、お茶会", "救護院を経営する優しい庶民派お嬢様", 10, 17, 156, "サレンディア救護院", "A", "堀江由衣", 102801, "サレン", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, 24, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 4, "舞台鑑賞、ダンス", "歌って踊れる大人気アイドル", 1, 17, 157, "カルミナ", "B", "日笠陽子", 102901, "ノゾミ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (51, 31, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 15, "忍法開発", "トーゴクの神秘、オシエテクダサイ！", 8, 16, 163, "ヴァイスフリューゲル　ランドソル支部", "O", "佐藤聡美", 103001, "ニノン", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, 22, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 7, "占い", "占いが得意な霊能少女", 12, 18, 157, "悪魔偽王国軍（ディアボロス）", "AB", "大坪由佳", 103101, "シノブ", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (45, 12, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 12, "慈善事業", "一人前の商人を目指すパワフルお嬢様", 3, 18, 157, "メルクリウス財団", "AB", "松嵜麗", 103201, "アキノ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (35, 3, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 11, "漫才", "みんなを笑顔にするお笑い牧場主", 3, 20, 142, "牧場（エリザベスパーク）", "B", "新田恵海", 103301, "マヒル", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (55, 16, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 12, "ウインドーショッピング", "純情でほっとけない大人の女性", 3, 22, 164, "メルクリウス財団", "A", "今井麻美", 103401, "ユカリ", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (21, 2, "test", 5, "お勉強", "礼儀正しくしっかり者のちびっ子優等生", 2, 8, 118, "リトルリリカル", "A", "小倉唯", 103601, "キョウカ", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, 11, "test", 8, "剣術、年長者をからかう", "義理堅くてからかい好きな剣術少女", 8, 13, 149, "王宮騎士団（NIGHTMARE）", "A", "茅原実里", 103701, "トモ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, 3, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 11, "読書、お散歩", "読書が趣味の病弱少女", 11, 14, 153, "牧場（エリザベスパーク）", "A", "小清水亜美", 103801, "シオリ", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (44, 6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 6, "友達作りのイメトレ", "「友達」に憧れる、エルフの森の女の子", 6, 13, 158, "フォレスティエ", "AB", "花澤香菜", 104001, "アオイ", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, 3, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 4, "各種楽器", "人々を守るために歌う、唱喚士の少女", 6, 17, 163, "カルミナ", "O", "福原綾香", 104201, "チカ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (54, 9, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 10, "お菓子作り", "男勝りで情に厚いワイルド娘", 8, 17, 168, "自警団（カォン）", "O", "小松未可子", 104301, "マコト", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (50, 5, "test", 7, "世界征服", "かつては夜を支配した最強の吸血鬼", 5, "??", 172, "悪魔偽王国軍（ディアボロス）", "A", "丹下桜", 104401, "イリヤ", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (49, 19, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 15, "小説を読むこと", "妄想大好き！　ほんとは照れ屋な女の子", 11, 18, 157, "ヴァイスフリューゲル　ランドソル支部", "AB", "長妻樹里", 104501, "クウカ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (48, 1, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 12, "猫とたわむれること", "弱きを助け強きをくじく猫娘", 3, 18, 158, "メルクリウス財団", "AB", "沼倉愛美", 104601, "タマキ", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (50, 25, "？？？", 8, "格闘技、湯浴み", "素顔を見せない冷静沈着な女性騎士", 10, 25, 171, "王宮騎士団（NIGHTMARE）", "A", "川澄綾子", 104701, "ジュン", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (49, 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 12, "傭兵などのアルバイト", "仕事も私事も効率優先な傭兵少女", 11, 20, 163, "メルクリウス財団", "O", "田所あずさ", 104801, "ミフユ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (54, 24, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 3, "家事全般", "お姉ちゃんがお世話してあげるからねっ！", 10, 18, 168, "ラビリンス", "O", "生天目仁美", 104901, "シズル", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (22, 3, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 14, "ファッション誌鑑賞、コスメ集め", "ちょっとおませな恋に恋する女の子", 1, 11, 120, "ルーセント学院", "A", "久野美咲", 105001, "ミサキ", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (53, 7, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 13, "研究、実験", "実験が趣味の危険な科学者", 3, 27, 166, "トワイライトキャラバン", "A", "三石琴乃", 105101, "ミツキ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (100, 14, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 11, "毛繕い、お喋り", "乙女チックなもふもふアニマル", 3, 18, 150, "牧場（エリザベスパーク）", "A", "徳井青空", 105201, "リマ", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (33, 28, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 15, "お菓子屋通い", "見た目も中身もお子ちゃまな異国の軍人", 7, 18, 140, "ヴァイスフリューゲル　ランドソル支部", "A", "辻あゆみ", 105301, "モニカ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (45, 7, "test", 4, "裁縫", "ファッション大好きなキュートガール", 9, 14, 153, "カルミナ", "AB", "木戸衣吹", 105401, "ツムギ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, 7, "test", 15, "観察", "どこまでも一途に慕う、純情乙女", 4, 16, 155, "ヴァイスフリューゲル　ランドソル支部", "O", "大関英里", 105501, "アユミ", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (54, 11, "test", 13, "釣り", "人情味溢れる粋でいなせな「姉御」", 7, 25, 167, "トワイライトキャラバン", "B", "佐藤利奈", 105601, "ルカ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (45, 10, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", "", "冒険、おしゃべり", "空への冒険を夢見る騎空士の少女", 3, 17, 156, "？？？", "O", "金元寿子", 105701, "ジータ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, 31, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", 1, "食べ歩き、料理", "いつも元気な腹ペコ少女", 3, 17, 156, "美食殿", "O", "M・A・O", 105801, "ペコリーヌ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (35, 11, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 1, "瞑想、動植物の飼育", "主を慕う、小さなガイド役", 5, 11, 140, "美食殿", "B", "伊藤美来", 105901, "コッコロ", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (39, 2, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 1, "猫と遊ぶ", "行き倒れの謎のネコミミ魔法使い", 9, 14, 152, "美食殿", "A", "立花理香", 106001, "キャル", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, 11, "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ", "", "冒険、思い出話", "さまよえる謎の少女", 8, 16, 148, "？？？", "O", "潘めぐみ", 106101, "ムイミ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, 17, "", "", "キレイな葉っぱを集めること", "森番を目指すエルフの少女", 6, 15, 155, "？？？", "O", "優木かな", 106301, "アリサ", 0, "エルフ");
