INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("??", 24, "", "", "物真似、芸術鑑賞", "研究所に隠れ住む物静かなお姉さん", 3, 24, 149, "？？？", "O", "井口裕香", 107001, "ネネカ", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES ("??", 7, "", 8, "強敵との闘争", "傍若無人な王宮騎士団副団長", 2, 27, 165, "王宮騎士団（NIGHTMARE）", "O", "たかはし智秋", 107101, "クリスティーナ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, 31, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", 1, "食べ歩き、料理", "いつも元気な腹ペコ少女", 3, 17, 156, "美食殿", "O", "M・A・O", 107501, "ペコリーヌ（サマー）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (35, 11, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 1, "瞑想、動植物の飼育", "主を慕う、小さなガイド役", 5, 11, 140, "美食殿", "B", "伊藤美来", 107601, "コッコロ（サマー）", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 9, "ご奉仕", "お嬢さまのためにがんばるドジっ娘メイド", 12, 15, 154, "サレンディア救護院", "O", "悠木碧", 107701, "スズメ（サマー）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (39, 2, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 1, "猫と遊ぶ", "行き倒れの謎のネコミミ魔法使い", 9, 14, 152, "美食殿", "A", "立花理香", 107801, "キャル（サマー）", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (48, 1, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 12, "猫とたわむれること", "弱きを助け強きをくじく猫娘", 3, 18, 158, "メルクリウス財団", "AB", "沼倉愛美", 107901, "タマキ（サマー）", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (49, 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 12, "傭兵などのアルバイト", "仕事も私事も効率優先な傭兵少女", 11, 20, 163, "メルクリウス財団", "O", "田所あずさ", 108001, "ミフユ（サマー）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, 22, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 7, "占い", "占いが得意な霊能少女", 12, 18, 157, "悪魔偽王国軍（ディアボロス）", "AB", "大坪由佳", 108101, "シノブ（ハロウィン）", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (32, 23, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 7, "プリンを食べること", "プリン大好きゴースト娘", 1, 14, 130, "悪魔偽王国軍（ディアボロス）", "B", "雨宮天", 108201, "ミヤコ（ハロウィン）", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (22, 3, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 14, "ファッション誌鑑賞、コスメ集め", "ちょっとおませな恋に恋する女の子", 1, 11, 120, "ルーセント学院", "A", "久野美咲", 108301, "ミサキ（ハロウィン）", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, 3, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 4, "各種楽器", "人々を守るために歌う、唱喚士の少女", 6, 17, 163, "カルミナ", "O", "福原綾香", 108401, "チカ（クリスマス）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 9, "観劇、おままごと", "泣き虫で臆病な守ってあげたい女の子", 6, 12, 150, "サレンディア救護院", "B", "植田佳奈", 108501, "クルミ（クリスマス）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (38, 10, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 9, "屋内でできる遊び", "ぷうきちといつも一緒！", 5, 14, 148, "サレンディア救護院", "B", "芹澤優", 108601, "アヤネ（クリスマス）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (44, 27, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 2, "人助け、応援", "人助けが大好き！　前向き格闘娘", 8, 16, 155, "トゥインクルウィッシュ", "A", "東山奈央", 108701, "ヒヨリ（ニューイヤー）", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (47, 5, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 2, "料理、人間観察", "戦闘のサポートが得意な、心優しい少女", 4, 17, 158, "トゥインクルウィッシュ", "O", "種田梨沙", 108801, "ユイ（ニューイヤー）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, 12, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 2, "読書、乗馬、お茶", "クールで何事にも真っ直ぐな剣士", 1, 18, 163, "トゥインクルウィッシュ", "B", "早見沙織", 108901, "レイ（ニューイヤー）", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, 30, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 13, "実験、裁縫、料理", "運命の相手に一途すぎる乙女", 7, 16, 154, "トワイライトキャラバン", "B", "橋本ちなみ", 109001, "エリコ（バレンタイン）", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (54, 24, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 3, "家事全般", "お姉ちゃんがお世話してあげるからねっ！", 10, 18, 168, "ラビリンス", "O", "生天目仁美", 109101, "シズル（バレンタイン）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (55, 1, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "", "読書", "英霊と契約を結んだマナリアの天才王女", 12, 17, 156, "？？？", "AB", "日笠陽子", 109201, "アン", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (45, 4, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "", "食べること、眠ること", "マナリア魔法学院の新入生", 2, 15, 144, "？？？", "O", "こやまきみこ", 109301, "ルゥ", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (67, 3, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "", "ピアノ", "人を超越した力を有す心優しい竜姫", 11, 17, 167, "？？？", "B", "福原綾香", 109401, "グレア", 0, "半人半竜");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (49, 19, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 15, "小説を読むこと", "妄想大好き！　ほんとは照れ屋な女の子", 11, 18, 157, "ヴァイスフリューゲル　ランドソル支部", "AB", "長妻樹里", 109501, "クウカ（オーエド）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (51, 31, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 15, "忍法開発", "トーゴクの神秘、オシエテクダサイ！", 8, 16, 163, "ヴァイスフリューゲル　ランドソル支部", "O", "佐藤聡美", 109601, "ニノン（オーエド）", 0, "ヒューマン");
