INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (52, 14, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 14, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "多くの男性を魅了する無垢な女教師", 8, 23, 162, "ルーセント学院", "B", "伊藤静", 110101, "イオ（サマー）", 0, "魔族");
