INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (53, 7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 10, "踊り、空手", "いつでも「なんくるないさ～」な天然娘", 7, 19, 158, "自警団（カォン）", "A", "高森奈津美", 110501, "カオリ（サマー）", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, 22, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 10, "空想、ぬいぐるみ集め", "マホマホ王国のプリンセス", 9, 16, 155, "自警団（カォン）", "O", "内田真礼", 110601, "マホ（サマー）", 0, "獣人族");
