INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, 12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 9, "ご奉仕", "お嬢さまのためにがんばるドジっ娘メイド", 12, 15, 154, "サレンディア救護院", "O", "悠木碧", 112101, "スズメ（ニューイヤー）", 0, "ヒューマン");
