INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (45, 5, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 13, "小説執筆", "前世を信じる中二病患者、「疾風の冥姫」", 7, 17, 159, "トワイライトキャラバン", "A", "髙野麻美", 113201, "アンナ（サマー）", 0, "魔族");
