INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, 24, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 6, "妹と遊ぶこと、二度寝、昼寝、早寝", "みんなのために超能力を使う眠り姫", 12, 17, 156, "フォレスティエ", "A", "大橋彩香", 113401, "ハツネ（サマー）", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (54, 5, "", 6, "絵本作り", "母性溢れる優しいみんなの「ミサト先生」", 9, 21, 165, "フォレスティエ", "O", "國府田マリ子", 113501, "ミサト（サマー）", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (50, 25, "", 8, "格闘技、湯浴み", "素顔を見せない冷静沈着な女性騎士", 10, 25, 171, "王宮騎士団（NIGHTMARE）", "A", "川澄綾子", 113601, "ジュン（サマー）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, 22, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 7, "サックス", "甘え上手なみんなの人気者", 11, 13, 150, "悪魔偽王国軍（ディアボロス）", "O", "浅倉杏美", 113701, "アカリ（エンジェル）", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, 22, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 7, "ゲーム全般", "人見知りであまのじゃくな女の子", 11, 13, 150, "悪魔偽王国軍（ディアボロス）", "O", "原紗友里", 113801, "ヨリ（エンジェル）", 0, "魔族");
