INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, 12, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 2, "読書、乗馬、お茶", "クールで何事にも真っ直ぐな剣士", 1, 18, 163, "トゥインクルウィッシュ", "B", "早見沙織", 114001, "レイ（ハロウィン）", 0, "魔族");
