INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (33, 28, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 15, "お菓子屋通い", "見た目も中身もお子ちゃまな異国の軍人", 7, 18, 140, "ヴァイスフリューゲル　ランドソル支部", "A", "辻あゆみ", 114201, "モニカ（マジカル）", 0, "ヒューマン");
