INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (45, 12, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 12, "慈善事業", "一人前の商人を目指すパワフルお嬢様", 3, 18, 157, "メルクリウス財団", "AB", "松嵜麗", 114401, "アキノ（クリスマス）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, 4, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 9, "経営、お茶会", "救護院を経営する優しい庶民派お嬢様", 10, 17, 156, "サレンディア救護院", "A", "堀江由衣", 114501, "サレン（クリスマス）", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (55, 16, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 12, "ウインドーショッピング", "純情でほっとけない大人の女性", 3, 22, 164, "メルクリウス財団", "A", "今井麻美", 114601, "ユカリ（クリスマス）", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, 11, "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ", "", "冒険、思い出話", "さまよえる謎の少女", 8, 16, 148, "？？？", "O", "潘めぐみ", 114701, "ムイミ（ニューイヤー）", 0, "ヒューマン");
