INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (35, 11, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", 1, "瞑想、動植物の飼育", "主を慕う、小さなガイド役", 5, 11, 140, "美食殿", "B", "伊藤美来", 115501, "コッコロ（儀装束）", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (47, 5, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 2, "料理、人間観察", "戦闘のサポートが得意な、心優しい少女", 4, 17, 158, "トゥインクルウィッシュ", "O", "種田梨沙", 115601, "ユイ（儀装束）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (41, 3, "", 10, "読書、推理", "頭脳明晰な美少女名探偵", 11, 15, 152, "自警団（カォン）", "AB", "水瀬いのり", 115701, "カスミ（サマー）", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (100, 14, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", 11, "毛繕い、お喋り", "乙女チックなもふもふアニマル", 3, 18, 150, "牧場（エリザベスパーク）", "A", "徳井青空", 115801, "リマ（シンデレラ）", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (54, 9, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 10, "お菓子作り", "男勝りで情に厚いワイルド娘", 8, 17, 168, "自警団（カォン）", "O", "小松未可子", 115901, "マコト（シンデレラ）", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, 22, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 10, "空想、ぬいぐるみ集め", "マホマホ王国のプリンセス", 9, 16, 155, "自警団（カォン）", "O", "内田真礼", 116001, "マホ（シンデレラ）", 0, "獣人族");
