INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (48, 1, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 12, "猫とたわむれること", "弱きを助け強きをくじく猫娘", 3, 18, 158, "メルクリウス財団", "AB", "沼倉愛美", 116801, "タマキ（作業服）", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (49, 11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 12, "傭兵などのアルバイト", "仕事も私事も効率優先な傭兵少女", 11, 20, 163, "メルクリウス財団", "O", "田所あずさ", 116901, "ミフユ（作業服）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, 30, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 13, "実験、裁縫、料理", "運命の相手に一途すぎる乙女", 7, 16, 154, "トワイライトキャラバン", "B", "橋本ちなみ", 117001, "エリコ（サマー）", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (54, 24, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 3, "家事全般", "お姉ちゃんがお世話してあげるからねっ！", 10, 18, 168, "ラビリンス", "O", "生天目仁美", 117101, "シズル（サマー）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, 24, "", 4, "舞台鑑賞、ダンス", "歌って踊れる大人気アイドル", 1, 17, 157, "カルミナ", "B", "日笠陽子", 117201, "ノゾミ（サマー）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, 3, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 4, "各種楽器", "人々を守るために歌う、唱喚士の少女", 6, 17, 163, "カルミナ", "O", "福原綾香", 117301, "チカ（サマー）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (45, 7, "", 4, "裁縫", "ファッション大好きなキュートガール", 9, 14, 153, "カルミナ", "AB", "木戸衣吹", 117401, "ツムギ（サマー）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (53, 7, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 13, "研究、実験", "実験が趣味の危険な科学者", 3, 27, 166, "トワイライトキャラバン", "A", "三石琴乃", 117501, "ミツキ（オーエド）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (40, 10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 15, "鏡で自分を見ること", "ボクは誰よりも美しい", 10, 14, 150, "ヴァイスフリューゲル　ランドソル支部", "AB", "大空直美", 117601, "ユキ（オーエド）", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (53, 7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 10, "踊り、空手", "いつでも「なんくるないさ～」な天然娘", 7, 19, 158, "自警団（カォン）", "A", "高森奈津美", 117701, "カオリ（ハロウィン）", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (51, 31, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 15, "忍法開発", "トーゴクの神秘、オシエテクダサイ！", 8, 16, 163, "ヴァイスフリューゲル　ランドソル支部", "O", "佐藤聡美", 117801, "ニノン（ハロウィン）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (48, 10, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 14, "ファッション", "天真爛漫で人気者のカリスマモデル", 4, 18, 167, "ルーセント学院", "O", "上坂すみれ", 117901, "スズナ（ハロウィン）", 0, "魔族");
