INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (52, 14, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 14, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "多くの男性を魅了する無垢な女教師", 8, 23, 162, "ルーセント学院", "B", "伊藤静", 119001, "イオ（ノワール）", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (49, 19, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 15, "小説を読むこと", "妄想大好き！　ほんとは照れ屋な女の子", 11, 18, 157, "ヴァイスフリューゲル　ランドソル支部", "AB", "長妻樹里", 119101, "クウカ（ノワール）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (35, 3, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 11, "漫才", "みんなを笑顔にするお笑い牧場主", 3, 20, 142, "牧場（エリザベスパーク）", "B", "新田恵海", 119201, "マヒル（クリスマス）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (44, 25, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 3, "お裁縫", "人懐っこくてマシンガントークな妹系少女", 8, 15, 156, "ラビリンス", "A", "阿澄佳奈", 119301, "リノ（クリスマス）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (32, 23, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 7, "プリンを食べること", "プリン大好きゴースト娘", 1, 14, 130, "悪魔偽王国軍（ディアボロス）", "B", "雨宮天", 119901, "ミヤコ（クリスマス）", 0, "魔族");
