INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (22, 3, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 14, "ファッション誌鑑賞、コスメ集め", "ちょっとおませな恋に恋する女の子", 1, 11, 120, "ルーセント学院", "A", "久野美咲", 121401, "ミサキ（ステージ）", 0, "魔族");
