INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (45, 5, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 13, "小説執筆", "前世を信じる中二病患者、「疾風の冥姫」", 7, 17, 159, "トワイライトキャラバン", "A", "髙野麻美", 121901, "アンナ（パイレーツ）", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, 22, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 7, "占い", "占いが得意な霊能少女", 12, 18, 157, "悪魔偽王国軍（ディアボロス）", "AB", "大坪由佳", 122001, "シノブ（パイレーツ）", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (44, 6, "", 6, "友達作りのイメトレ", "「友達」に憧れる、エルフの森の女の子", 6, 13, 158, "フォレスティエ", "AB", "花澤香菜", 122101, "アオイ（キャンプ）", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (55, 16, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 12, "ウインドーショッピング", "純情でほっとけない大人の女性", 3, 22, 164, "メルクリウス財団", "A", "今井麻美", 122201, "ユカリ（キャンプ）", 0, "エルフ");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (41, 6, "", "", "お散歩、お料理", "けんぞくのご主人様", 12, "??", 149, "？？？", "AB", "釘宮理恵", 122301, "ヴァンピィ", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (44, 27, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 2, "人助け、応援", "人助けが大好き！　前向き格闘娘", 8, 16, 155, "トゥインクルウィッシュ", "A", "東山奈央", 122401, "ヒヨリ（サマー）", 0, "獣人族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (46, 12, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 2, "読書、乗馬、お茶", "クールで何事にも真っ直ぐな剣士", 1, 18, 163, "トゥインクルウィッシュ", "B", "早見沙織", 122501, "レイ（サマー）", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (47, 5, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 2, "料理、人間観察", "戦闘のサポートが得意な、心優しい少女", 4, 17, 158, "トゥインクルウィッシュ", "O", "種田梨沙", 122601, "ユイ（サマー）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (21, 2, "", 5, "お勉強", "礼儀正しくしっかり者のちびっ子優等生", 2, 8, 118, "リトルリリカル", "A", "小倉唯", 122701, "キョウカ（サマー）", 0, "エルフ");
