INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (49, 19, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 15, "小説を読むこと", "妄想大好き！　ほんとは照れ屋な女の子", 11, 18, 157, "ヴァイスフリューゲル　ランドソル支部", "AB", "長妻樹里", 127001, "クウカ（サマー）", 0, "ヒューマン");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (42, 22, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 7, "占い", "占いが得意な霊能少女", 12, 18, 157, "悪魔偽王国軍（ディアボロス）", "AB", "大坪由佳", 127101, "シノブ（サマー）", 0, "魔族");
INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (39, 2, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", 1, "猫と遊ぶ", "行き倒れの謎のネコミミ魔法使い", 9, 14, 152, "美食殿", "A", "立花理香", 127201, "キャル（編入生）", 0, "獣人族");
