INSERT INTO `v1_4e93cc995d73079c09ed2e5d55fe9483ab618d3a3d38b09e1e5b756c327802c7` VALUES (43, 4, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 9, "経営、お茶会", "救護院を経営する優しい庶民派お嬢様", 10, 17, 156, "サレンディア救護院", "A", "堀江由衣", 127501, "サレン（サラサリア）", 0, "エルフ");
